import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion';
import { 
  MapPin, 
  Car, 
  Cloud, 
  Settings, 
  Play, 
  ArrowLeft,
  Zap,
  Leaf,
  Flame,
  Droplets,
  Sun,
  CloudRain,
  Loader2
} from 'lucide-react';
import './SimulationSetup.css';

const SimulationSetup = () => {
  const navigate = useNavigate();
  const [selectedTrack, setSelectedTrack] = useState('');
  const [drivingMode, setDrivingMode] = useState('eco');
  const [weather, setWeather] = useState('dry');
  const [surface, setSurface] = useState('smooth');
  const [modelVersion, setModelVersion] = useState('ppo');
  const [tracks, setTracks] = useState([]);
  const [loadingTracks, setLoadingTracks] = useState(true);

  // Track metadata for display purposes
  const trackMetadata = {
    'Catalunya': { country: 'Spain', length: '4.655 km', difficulty: 'Medium' },
    'IMS': { country: 'USA', length: '4.023 km', difficulty: 'Medium' },
    'Silverstone': { country: 'United Kingdom', length: '5.891 km', difficulty: 'Medium' },
    'Monza': { country: 'Italy', length: '5.793 km', difficulty: 'High' },
    'Spa': { country: 'Belgium', length: '7.004 km', difficulty: 'High' },
    'YasMarina': { country: 'UAE', length: '5.554 km', difficulty: 'Medium' },
    'Austin': { country: 'USA', length: '5.513 km', difficulty: 'Medium' },
    'BrandsHatch': { country: 'United Kingdom', length: '3.916 km', difficulty: 'High' },
    'Budapest': { country: 'Hungary', length: '4.381 km', difficulty: 'Medium' },
    'Hockenheim': { country: 'Germany', length: '4.574 km', difficulty: 'Medium' },
    'Melbourne': { country: 'Australia', length: '5.303 km', difficulty: 'Medium' },
    'Mexico City': { country: 'Mexico', length: '4.304 km', difficulty: 'High' },
    'Montreal': { country: 'Canada', length: '4.361 km', difficulty: 'Medium' },
    'MoscowRaceway': { country: 'Russia', length: '3.931 km', difficulty: 'Medium' },
    'Nuerburgring': { country: 'Germany', length: '5.148 km', difficulty: 'Very High' },
    'Oschersleben': { country: 'Germany', length: '3.696 km', difficulty: 'Medium' },
    'Sakhir': { country: 'Bahrain', length: '5.412 km', difficulty: 'Medium' },
    'SaoPaulo': { country: 'Brazil', length: '4.309 km', difficulty: 'High' },
    'Sepang': { country: 'Malaysia', length: '5.543 km', difficulty: 'Medium' },
    'Shanghai': { country: 'China', length: '5.451 km', difficulty: 'Medium' },
    'Sochi': { country: 'Russia', length: '5.848 km', difficulty: 'Medium' },
    'Spielberg': { country: 'Austria', length: '4.318 km', difficulty: 'Medium' },
    'Zandvoort': { country: 'Netherlands', length: '4.259 km', difficulty: 'High' }
  };

  const drivingModes = [
    {
      id: 'eco',
      name: 'Eco Mode',
      description: 'Maximum fuel efficiency and minimal emissions',
      icon: Leaf,
      color: '#00ff88',
      characteristics: ['Low fuel consumption', 'Smooth acceleration', 'Early braking', 'Optimal gear shifting']
    },
    {
      id: 'balanced',
      name: 'Balanced Mode',
      description: 'Balance between performance and efficiency',
      icon: Zap,
      color: '#ff6b35',
      characteristics: ['Moderate fuel consumption', 'Balanced acceleration', 'Standard braking', 'Adaptive gear shifting']
    },
    {
      id: 'aggressive',
      name: 'Aggressive Mode',
      description: 'Maximum performance and speed',
      icon: Flame,
      color: '#ff1744',
      characteristics: ['High fuel consumption', 'Rapid acceleration', 'Late braking', 'Performance gear shifting']
    }
  ];

  const weatherConditions = [
    { id: 'dry', name: 'Dry', icon: Sun, description: 'Optimal conditions' },
    { id: 'light_rain', name: 'Light Rain', icon: CloudRain, description: 'Reduced grip' },
    { id: 'heavy_rain', name: 'Heavy Rain', icon: Droplets, description: 'Significant grip loss' }
  ];

  const surfaceConditions = [
    { id: 'smooth', name: 'Smooth', description: 'Optimal surface conditions' },
    { id: 'rough', name: 'Rough', description: 'Increased rolling resistance' },
    { id: 'wet', name: 'Wet', description: 'Reduced traction' }
  ];

  const modelVersions = [
    { id: 'ppo', name: 'PPO (Proximal Policy Optimization)', description: 'Stable and reliable' },
    { id: 'sac', name: 'SAC (Soft Actor-Critic)', description: 'High performance' },
    { id: 'td3', name: 'TD3 (Twin Delayed DDPG)', description: 'Advanced optimization' }
  ];

  // Load tracks from backend on component mount
  useEffect(() => {
    const loadTracks = async () => {
      try {
        setLoadingTracks(true);
        const response = await fetch('http://localhost:5000/api/tracks');
        const data = await response.json();
        
        // Transform track names into track objects with metadata
        const trackList = data.map(trackName => {
          const metadata = trackMetadata[trackName] || { 
            country: 'Unknown', 
            length: 'Unknown', 
            difficulty: 'Unknown' 
          };
          
          return {
            id: trackName.toLowerCase().replace(/\s+/g, '_'),
            name: trackName,
            country: metadata.country,
            length: metadata.length,
            difficulty: metadata.difficulty,
            image: '/api/placeholder/300/200'
          };
        });
        
        setTracks(trackList);
        
        // Set default selected track to first available track
        if (trackList.length > 0 && !selectedTrack) {
          setSelectedTrack(trackList[0].id);
        }
      } catch (error) {
        console.error('Failed to load tracks:', error);
        // Fallback to a few default tracks if API fails
        setTracks([
          {
            id: 'silverstone',
            name: 'Silverstone',
            country: 'United Kingdom',
            length: '5.891 km',
            difficulty: 'Medium',
            image: '/api/placeholder/300/200'
          },
          {
            id: 'monza',
            name: 'Monza',
            country: 'Italy',
            length: '5.793 km',
            difficulty: 'High',
            image: '/api/placeholder/300/200'
          }
        ]);
      } finally {
        setLoadingTracks(false);
      }
    };

    loadTracks();
  }, [selectedTrack]);

  const handleStartSimulation = () => {
    // Find the selected track object to get the actual track name
    const selectedTrackObj = tracks.find(track => track.id === selectedTrack);
    const trackName = selectedTrackObj ? selectedTrackObj.name : selectedTrack;
    
    const simulationConfig = {
      track: trackName,  // Use actual track name instead of ID
      drivingMode,
      weather,
      surface,
      modelVersion
    };
    
    // Store config in localStorage for the dashboard
    localStorage.setItem('simulationConfig', JSON.stringify(simulationConfig));
    
    // Navigate to dashboard
    navigate('/dashboard');
  };

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.5,
        ease: "easeOut"
      }
    }
  };

  return (
    <div className="simulation-setup">
      <div className="container">
        <motion.div 
          className="setup-header"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.div className="header-nav" variants={itemVariants}>
            <Link to="/" className="back-button">
              <ArrowLeft size={20} />
              Back to Home
            </Link>
          </motion.div>
          
          <motion.h1 className="setup-title" variants={itemVariants}>
            Simulation Setup
          </motion.h1>
          
          <motion.p className="setup-description" variants={itemVariants}>
            Configure your simulation parameters to experience AI-powered driving optimization
          </motion.p>
        </motion.div>

        <motion.div 
          className="setup-content"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          {/* Track Selection */}
          <motion.div className="setup-section" variants={itemVariants}>
            <div className="section-header">
              <MapPin size={24} />
              <h2>Select Track</h2>
            </div>
            
            <div className="track-grid">
              {loadingTracks ? (
                <div className="loading-container">
                  <Loader2 size={32} className="loading-spinner" />
                  <p>Loading tracks...</p>
                </div>
              ) : (
                tracks.map((track) => (
                  <motion.div
                    key={track.id}
                    className={`track-card ${selectedTrack === track.id ? 'selected' : ''}`}
                    onClick={() => setSelectedTrack(track.id)}
                    whileHover={{ scale: 1.02 }}
                    whileTap={{ scale: 0.98 }}
                  >
                    <div className="track-image">
                      <div className="track-placeholder">
                        <MapPin size={32} />
                      </div>
                    </div>
                    <div className="track-info">
                      <h3>{track.name}</h3>
                      <p className="track-country">{track.country}</p>
                      <div className="track-details">
                        <span>Length: {track.length}</span>
                        <span>Difficulty: {track.difficulty}</span>
                      </div>
                    </div>
                  </motion.div>
                ))
              )}
            </div>
          </motion.div>

          {/* Driving Mode Selection */}
          <motion.div className="setup-section" variants={itemVariants}>
            <div className="section-header">
              <Car size={24} />
              <h2>Driving Mode</h2>
            </div>
            
            <div className="mode-grid">
              {drivingModes.map((mode) => {
                const Icon = mode.icon;
                return (
                  <motion.div
                    key={mode.id}
                    className={`mode-card ${drivingMode === mode.id ? 'selected' : ''}`}
                    onClick={() => setDrivingMode(mode.id)}
                    whileHover={{ scale: 1.02 }}
                    whileTap={{ scale: 0.98 }}
                    style={{ '--mode-color': mode.color }}
                  >
                    <div className="mode-icon">
                      <Icon size={32} />
                    </div>
                    <h3>{mode.name}</h3>
                    <p>{mode.description}</p>
                    <ul className="mode-characteristics">
                      {mode.characteristics.map((char, index) => (
                        <li key={index}>{char}</li>
                      ))}
                    </ul>
                  </motion.div>
                );
              })}
            </div>
          </motion.div>

          {/* Weather & Surface Conditions */}
          <motion.div className="setup-section" variants={itemVariants}>
            <div className="section-header">
              <Cloud size={24} />
              <h2>Conditions</h2>
            </div>
            
            <div className="conditions-grid">
              <div className="condition-group">
                <h3>Weather</h3>
                <div className="condition-options">
                  {weatherConditions.map((condition) => {
                    const Icon = condition.icon;
                    return (
                      <motion.div
                        key={condition.id}
                        className={`condition-option ${weather === condition.id ? 'selected' : ''}`}
                        onClick={() => setWeather(condition.id)}
                        whileHover={{ scale: 1.05 }}
                        whileTap={{ scale: 0.95 }}
                      >
                        <Icon size={24} />
                        <span>{condition.name}</span>
                        <small>{condition.description}</small>
                      </motion.div>
                    );
                  })}
                </div>
              </div>
              
              <div className="condition-group">
                <h3>Surface</h3>
                <div className="condition-options">
                  {surfaceConditions.map((condition) => (
                    <motion.div
                      key={condition.id}
                      className={`condition-option ${surface === condition.id ? 'selected' : ''}`}
                      onClick={() => setSurface(condition.id)}
                      whileHover={{ scale: 1.05 }}
                      whileTap={{ scale: 0.95 }}
                    >
                      <span>{condition.name}</span>
                      <small>{condition.description}</small>
                    </motion.div>
                  ))}
                </div>
              </div>
            </div>
          </motion.div>

          {/* Advanced Settings */}
          <motion.div className="setup-section" variants={itemVariants}>
            <div className="section-header">
              <Settings size={24} />
              <h2>Advanced Settings</h2>
            </div>
            
            <div className="advanced-settings">
              <div className="setting-group">
                <label>AI Model Version</label>
                <select 
                  value={modelVersion} 
                  onChange={(e) => setModelVersion(e.target.value)}
                  className="form-select"
                >
                  {modelVersions.map((model) => (
                    <option key={model.id} value={model.id}>
                      {model.name} - {model.description}
                    </option>
                  ))}
                </select>
              </div>
            </div>
          </motion.div>

          {/* Start Simulation */}
          <motion.div className="setup-actions" variants={itemVariants}>
            <motion.button
              className="btn-primary start-simulation"
              onClick={handleStartSimulation}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              <Play size={20} />
              Start Simulation
            </motion.button>
          </motion.div>
        </motion.div>
      </div>
    </div>
  );
};

export default SimulationSetup;
